importr
import '../src/css/skeleton.css';

function App() {
  return (
    <div className="App">
      <body>
        <div className="container">
          <div className="row">
            <div className="four columns">
              <div className='mfio-card'>
                <img className='avi' src='https://avatars.githubusercontent.com/u/77665167?v=4'></img>
                <div className='name-plate'>
                <h6><b>Matthieu</b> Felker</h6>
                </div>
              </div>
            </div>  
          </div>
        </div>
      </body>
    </div>
  );
}

export default App;
